    "Temporary directory is correctly configured:\n%s" : "Direktori sementara dikonfigurasi dengan benar:\n%s",
    "This instance uses an S3 based object store as primary storage, and has enough space in the temporary directory.\n%s" : "Instans ini menggunakan object store berbasis S3 sebagai penyimpanan utama, dan memiliki ruang yang cukup di direktori sementara.\n%s",
    "This instance uses an S3 based object store as primary storage. The uploaded files are stored temporarily on the server and thus it is recommended to have 50 GiB of free space available in the temp directory of PHP. To improve this please change the temporary directory in the php.ini or make more space available in that path. \nChecking the available space in the temporary path resulted in %.1f GiB instead of the recommended 50 GiB. Path: %s" : "Instans ini menggunakan object store berbasis S3 sebagai penyimpanan utama. File yang diunggah disimpan sementara di server dan karena itu disarankan memiliki ruang kosong 50 GiB di direktori temp PHP. Untuk memperbaiki ini, ubah direktori sementara di php.ini atau sediakan lebih banyak ruang pada path tersebut. \nPemeriksaan ruang yang tersedia pada path sementara menghasilkan %.1f GiB, bukan 50 GiB yang direkomendasikan. Path: %s",
